const audioData = items[0].json.body.audio;

if (!audioData) {
  throw new Error('No audio data found');
}

const audioBuffer = Buffer.from(audioData, 'base64');

return [{
  json: {},
  binary: {
    'audio.webm': {
      data: audioBuffer,
      mimeType: 'audio/webm',
      fileName: 'audio.webm'
    }
  }
}];

// Get OpenAI API key from n8n credentials
const openaiApiKey = $vars.OPENAI_API_KEY;

// Get transcribed text from Whisper node
const transcribedText = items[0].json.text || items[0].json.transcription;

// Get document type from original webhook data - check multiple locations
const webhookData = $node["Receive Voice Recording - Webhook"].json;

// Check different possible locations for document_type
const documentType = 
  webhookData.document_type || 
  webhookData.body?.document_type || 
  webhookData.query?.document_type || 
  'invoice';

// EXTENSIVE DEBUG: Show everything we have access to
console.log("=== WEBHOOK DEBUG ===");
console.log("Full webhook data:", JSON.stringify(webhookData, null, 2));
console.log("Webhook keys:", Object.keys(webhookData));
if (webhookData.body) {
  console.log("Webhook body keys:", Object.keys(webhookData.body));
  console.log("Body document_type:", webhookData.body.document_type);
}
console.log("Final document_type used:", documentType);
console.log("=== WHISPER DEBUG ===");
console.log("Whisper output keys:", Object.keys(items[0].json));

if (!transcribedText) {
  throw new Error('No transcribed text found');
}

// OpenAI API call to extract structured data
const openaiResponse = await this.helpers.httpRequest({
  method: 'POST',
  url: 'https://api.openai.com/v1/chat/completions',
  headers: {
    'Authorization': `Bearer ${openaiApiKey}`,
    'Content-Type': 'application/json'
  },
  body: {
    model: 'gpt-4',
    messages: [{
      role: 'system',
      content: `You are a plumbing data extraction assistant. Extract structured data from voice transcriptions.
When extracting costs, always capture the FULL dollar amount mentioned (e.g., if they say "twenty dollars", return 20, not 2).
Return ONLY valid JSON in this exact format:
{
  "customer_name": "string or null",
  "customer_address": "string or null", 
  "job_description": "string",
  "materials_cost": 0,
  "labor_hours": 0,
  "labor_rate": 85
}`
    }, {
      role: 'user',
      content: `Extract plumbing job data from: "${transcribedText}"`
    }],
    temperature: 0.1
  }
});

const extractedData = JSON.parse(openaiResponse.choices[0].message.content);

// Calculate Australian plumbing rates and GST - with number parsing
const laborRate = parseFloat(extractedData.labor_rate) || 85;
const laborHours = parseFloat(extractedData.labor_hours) || 0;
const materialsCost = parseFloat(extractedData.materials_cost) || 0;

const laborCost = laborHours * laborRate;
const subtotal = materialsCost + laborCost;
const gstAmount = subtotal * 0.10; // 10% GST in Australia
const totalAmount = subtotal + gstAmount;

// Add calculated fields - ensuring all are numbers
extractedData.materials_cost = materialsCost;
extractedData.labor_hours = laborHours;
extractedData.labor_cost = laborCost;
extractedData.subtotal = subtotal;
extractedData.gst_amount = gstAmount;
extractedData.total_amount = totalAmount;

// FINAL: Use the document type from original webhook
extractedData.document_type = documentType;

return [{
  json: {
    transcription: transcribedText,
    extracted_data: extractedData,
    timestamp: new Date().toISOString(),
    DEBUG: {
      webhook_full_data: webhookData,
      webhook_body: webhookData.body || null,
      received_document_type: webhookData.document_type,
      received_body_document_type: webhookData.body?.document_type,
      final_document_type: extractedData.document_type,
      whisper_keys: Object.keys(items[0].json)
    }
  }
}];
